import React, {Component} from 'react';

class Login extends Component{
    state = {
        username: "shivam.oe@objectedge.com",
        password: "oe@123"
    }
    render(){
        return(
            <div>
                <h2>Login</h2>
                <form action="post">
                    <input type="text"/>
                    <input type="password"/>
                    <input type="submit"/>
                </form>
            </div> 
        );
    }
}

export default Login;
